  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `sort` bigint(20) NOT NULL COMMENT '排序',
  `create_by` bigint(20) NOT NULL COMMENT '关联至用户表，创建人',
  `create_time` datetime NOT NULL COMMENT '操作时间',
  `update_by` bigint(20) NULL DEFAULT NULL COMMENT '关联至用户表，修改人',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `is_delete` bit(1) NOT NULL DEFAULT b'0' COMMENT '0：存在；1：已删除，不存在',
  PRIMARY KEY (`w_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 38 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '仓库表' ROW_FORMAT = Dynamic;

